css:
@-moz-document domain("youtube.com") {
    :root {
        --yt-primary-color: #5cb3ff;
        --yt-secondary-color: #4a4a4a;
        --yt-tertiary-color: #ffffff;
    }

    ytd-app, ytd-app > #content {
        background-color: #99d2ff;
    }

    ytd-masthead[role="banner"], ytd-masthead[role="navigation"] {
        background-color: #5cb3ff;
    }

    #search-icon-legacy {
        color: #ffffff !important;
    }

    .ytp-progress-bar-container {
        background-color: #ffffff !important;
    }

    .ytp-progress-bar, .ytp-progress-bar-container {
        border-color: #5cb3ff !important;
    }

    .ytp-time-display:not(.ytp-live):not(.ytp-duration-display) {
        background-color: #5cb3ff !important;
        color: #ffffff !important;
    }

    .ytp-chrome-bottom {
        background-color: #5cb3ff !important;
    }
}
